%script

--  Find the importance of attributes that independently impact the target attribute:  CREDIT_SCORE_BIN

BEGIN DBMS_DATA_MINING.DROP_MODEL('ai_explain_output_credit_score_bin');
EXCEPTION WHEN OTHERS THEN NULL; END;

DECLARE
    v_setlst DBMS_DATA_MINING.SETTING_LIST;
BEGIN
    v_setlst('ALGO_NAME')        := 'ALGO_AI_MDL';
    V_setlst('PREP_AUTO')        := 'ON';

    DBMS_DATA_MINING.CREATE_MODEL2(
        MODEL_NAME        => 'ai_explain_output_credit_score_bin',
        MINING_FUNCTION   => 'ATTRIBUTE_IMPORTANCE',
        DATA_QUERY        => 'select * from CREDIT_SCORING_100K_V',
        SET_LIST          => v_setlst,
        CASE_ID_COLUMN_NAME => 'CUSTOMER_ID',
        TARGET_COLUMN_NAME  => 'CREDIT_SCORE_BIN');
END;

