%script

-- Split the Data into random samples of 60% for training data (N1_TRAIN_DATA) for training the models and a 40% hold out sample for testing and evaluating the models (N1_TEST_DATA)
-- Note: The SAMPLE clause works providing that there are KEYS on the underlying table.

CREATE OR REPLACE VIEW N1_TRAIN_DATA AS SELECT * FROM CREDIT_SCORING_100K_V SAMPLE (60) SEED (1); 
CREATE OR REPLACE VIEW N1_TEST_DATA AS SELECT * FROM CREDIT_SCORING_100K_V MINUS SELECT * FROM N1_TRAIN_DATA;

%script

BEGIN
DBMS_DATA_MINING.DROP_MODEL('N1_CLASS_MODEL');
EXCEPTION WHEN OTHERS THEN NULL; 
END;

DECLARE
    v_setlst DBMS_DATA_MINING.SETTING_LIST;
BEGIN
    v_setlst('PREP_AUTO') := 'ON';
    v_setlst('ALGO_NAME') := 'ALGO_DECISION_TREE';
    DBMS_DATA_MINING.CREATE_MODEL2(
        'N1_CLASS_MODEL',
        'CLASSIFICATION',
        'SELECT * FROM N1_TRAIN_DATA',
        v_setlst,
        'CUSTOMER_ID',
        'CREDIT_SCORE_BIN');
END;

%script

-- Drop apply results and lift tables
BEGIN EXECUTE IMMEDIATE 'DROP TABLE N1_APPLY_RESULT PURGE';
EXCEPTION WHEN OTHERS THEN NULL; END;
/
BEGIN EXECUTE IMMEDIATE 'DROP TABLE N1_LIFT_TABLE PURGE';
EXCEPTION WHEN OTHERS THEN NULL; END;
/

-- Score the data and compute lift
BEGIN 
DBMS_DATA_MINING.APPLY('N1_CLASS_MODEL','N1_TEST_DATA','CUSTOMER_ID','N1_APPLY_RESULT');
DBMS_DATA_MINING.COMPUTE_LIFT('N1_APPLY_RESULT','N1_TEST_DATA','CUSTOMER_ID','CREDIT_SCORE_BIN','N1_LIFT_TABLE','Good Credit','PREDICTION','PROBABILITY',100);
END;

